import Login from './components/Login'
import Entrepreneur from  './Pages/Entrepreneur';
import Expert from './Pages/Expert';

import { FooterContainer } from './containers/footer'


function App() {
  return (
   <>
   <NavigationBar />
   <Banner />

   <FooterContainer />
   <Router>
